import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('#email');
    await page.waitForSelector('#password');

    // Fill in the login form
    await page.fill('#email', 'your_email@example.com'); // Replace with your email
    await page.fill('#password', 'your_password'); // Replace with your password

    // Click the login button
    await page.click('button.login-btn');
    await page.waitForLoadState('networkidle');

    // Take a screenshot after logging in
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_login.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_login.png'));

    // Wait for the profile picture to load
    await page.waitForSelector('img[alt="Profile picture"]'); // Adjust selector if necessary

    // Take a screenshot of the profile picture
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_profile_picture.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_profile_picture.png'));

    // Extract the profile picture URL
    const profilePictureUrl = await page.getAttribute('img[alt="Profile picture"]', 'src');

    return {
      success: true,
      action: "Downloaded own profile photo",
      extractedData: { profilePictureUrl },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

