import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the login form to be visible
    await page.waitForSelector('form#loginForm');

    // Fill in email and password
    await page.fill('#email', 'your_email@example.com'); // replace with actual email
    await page.fill('#password', 'your_password'); // replace with actual password

    // Take a screenshot after filling in the form
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_filled_form.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_filled_form.png'));

    // Click the login button
    await page.click('button.login-btn');

    // Wait for the home page to load
    await page.waitForLoadState('networkidle');

    // Take a screenshot of the home page
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_home_page.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_home_page.png'));

    // Extract profile photo URL
    const profilePhotoUrl = await page.evaluate(() => {
      const profilePhotoElement = document.querySelector('img[alt="Profile picture"]');
      return profilePhotoElement ? profilePhotoElement.src : null;
    });

    if (profilePhotoUrl) {
      // Download the profile photo
      const response = await page.goto(profilePhotoUrl);
      const buffer = await response.buffer();
      const profilePhotoPath = path.join(screenshotsDir, 'profile_photo.png');
      require('fs').writeFileSync(profilePhotoPath, buffer);
      screenshots.push(profilePhotoPath);
    }

    return {
      success: true,
      action: "Downloaded own profile photo",
      extractedData: { profilePhotoUrl },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
